import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const CustomTableCell = withStyles(theme => ({
  head: {
    backgroundColor: theme.palette.common.black,
    color: theme.palette.common.white,
  },
  body: {
    fontSize: 14,
  },
}))(TableCell);

const styles = theme => ({
  root: {
    width: '100%',
    marginTop: theme.spacing.unit * 4,
    overflowX: 'auto',
  },
  table: {
    minWidth: 700,
  },
  row: {
    '&:nth-of-type(odd)': {
      backgroundColor: theme.palette.background.default,
    },
  },
});

let id = 0;
function createData(name, calories, fat, carbs, protein) {
  id += 1;
  return { id, name, calories, fat, carbs, protein };
}

const rows = [
  createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
  createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
  createData('Eclair', 262, 16.0, 24, 6.0),
  createData('Cupcake', 305, 3.7, 67, 4.3),
  createData('Gingerbread', 356, 16.0, 49, 3.9),
];

function MealTable(props) {
  const { classes, inventory } = props;
  return (
    <Paper className={classes.root}>
      <Table className={classes.table}>
        <TableHead>
          <TableRow>
            <CustomTableCell>ID #</CustomTableCell>
            <CustomTableCell align="right">Meal Name</CustomTableCell>
            <CustomTableCell align="right">Location</CustomTableCell>
            <CustomTableCell align="right">Net Weight (oz)</CustomTableCell>
            <CustomTableCell align="right">Shelf Life (days)</CustomTableCell>
            <CustomTableCell align="right">Cost ($)</CustomTableCell>
            <CustomTableCell align="right">Category</CustomTableCell>
            <CustomTableCell align="right">Image</CustomTableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {inventory.map(row => (
            <TableRow className={classes.row} key={row.id}>
              <CustomTableCell component="th" scope="row">
                {row.idTemplate}
              </CustomTableCell>
              <CustomTableCell align="right">{row.strTemplate}</CustomTableCell>
              <CustomTableCell align="right">{row.location}</CustomTableCell>
              <CustomTableCell align="right">{row.netWeight}</CustomTableCell>
              <CustomTableCell align="right">{row.shelfLife}</CustomTableCell>
              <CustomTableCell align="right">{row.strCost}</CustomTableCell>
              <CustomTableCell align="right">{row.strCategory}</CustomTableCell>
              <CustomTableCell align="right">Image</CustomTableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </Paper>
  );
}

MealTable.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(MealTable);
